import React, { useState } from 'react';


function Works(props) {
  const projects = {
    display: 'flex',
    flexDirection: 'column'
  }

  const bgImage = {
    backgroundImage: props.image
  }

  return (
    <div style={projects}>
        <div className="project-one projects" style={bgImage}>
          <h1>{props.name}</h1>
          <img src={props.image}/>
          <p>View more</p>
        </div>
    </div>

  );
}

export default Works;
